import Category from '../components/frontend/Category';
import Company from '../components/frontend/Company';
import Order from '../components/frontend/Order';

const routes = [
    { path: '/category', exact: true, name: 'Category', component: Category },
    { path: '/company', exact: true, name: 'Company', component: Company },
    { path: '/order', exact: true, name: 'Order', component: Order },
];

export default routes;
